# hm gives us the player ID and Matrix is the whole shit
def populate(arr):
    for person in arr:
        for neighbor in arr:
            if person is not neighbor:
                pIndex = hm[person] - 1
                nIndex = hm[neighbor] - 1
                matrix[pIndex][nIndex] = 1
                matrix[nIndex][pIndex] = 1

